import React from "react";
import styled from "styled-components";

export const LayoutContainer = styled.div`
	min-width:100vh;
	min-height:100vh;
	border: 3px solid yellow;
	display: grid;
	grid-template-rows: 10% 90%;
	grid-template-columns: 10% 90%;
`;
